define([],function(){function fromSnakeToCamelCase(currentString){var parts=currentString.split(/[_-]/);var newString="";for(var i=1;i<parts.length;i++){newString+=parts[i].charAt(0).toUpperCase()+parts[i].slice(1);}
return parts[0]+newString;}
function fromCamelCaseToDash(currentString){return currentString.replace(/[A-Z]/g,function(m){return"-"+m.toLowerCase();});}
return{fromSnakeToCamelCase:fromSnakeToCamelCase,fromCamelCaseToDash:fromCamelCaseToDash};});